import * as React from "react";
import "./Experience.css";
import logo from "../../Images/tillsterlogo.jpeg";
import info from "../../Images/tillster.png";
import taxfyle from "../../Images/tax.png";
import gw from "../../Images/gw.png";
import iphone from "../../Images/iphone.png";

import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
function Experience() {
  return (
    <div id="experience">
      <h3 className="header">Experience</h3>
      {/* <div className="images">
        <img id="logo" src={logo} />
        <img id="info" src={info} />
      </div> */}
      {/* #91be4a */}
      {/* <div className="paragraph">
        <img src={gw} />
        <div className="text">
          <h4>Tillster</h4>
        </div>
      </div>
      <div className="paragraph">

      </div> */}
      <Grid container spacing={6}>
        <Grid item xs>
          <Box
            sx={{
              width: 400,
              height: 700,
              backgroundColor: "#91be4a",
              borderRadius: 8,
              "&:hover": {
                backgroundColor: "black",
                opacity: [0.9, 0.8, 0.7],
              },
            }}
          />
        </Grid>
        <Grid item xs>
          <Box
            sx={{
              width: 300,
              height: 300,
              borderRadius: 8,
              backgroundColor: "#91be4a",
              "&:hover": {
                backgroundColor: "black",
                opacity: [0.9, 0.8, 0.7],
              },
            }}
          />
        </Grid>
        <Grid item xs>
          <Box
            sx={{
              width: 300,
              height: 300,
              borderRadius: 8,
              backgroundColor: "#91be4a",
              "&:hover": {
                backgroundColor: "white",
              },
            }}
          />
        </Grid>
      </Grid>
    </div>
  );
}
export default Experience;
